--
-- Table structure for table `calendario`
--

DROP TABLE IF EXISTS `calendario`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `calendario` (
  `id` int NOT NULL AUTO_INCREMENT,
  `data` date NOT NULL,
  `dia_semana` tinyint(1) DEFAULT NULL COMMENT 'Dia da semana (1=Segunda, 2=Tera, ..., 7=Domingo)',
  `ano` int NOT NULL,
  `mes` int NOT NULL,
  `dia` int NOT NULL,
  `dia_semana_numero` int NOT NULL COMMENT '1=Segunda, 2=Tera, 3=Quarta, 4=Quinta, 5=Sexta, 6=Sbado, 7=Domingo',
  `dia_semana_nome` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Segunda, Tera, Quarta, Quinta, Sexta, Sbado, Domingo',
  `semana` int DEFAULT NULL COMMENT 'Nmero da semana do ano',
  `semana_numero` int NOT NULL COMMENT 'Nmero da semana no ano',
  `semana_ano` int NOT NULL COMMENT 'Ano da semana',
  `semana_inicio` date NOT NULL COMMENT 'Data de incio da semana (segunda-feira)',
  `semana_fim` date NOT NULL COMMENT 'Data de fim da semana (domingo)',
  `semana_abastecimento` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'Semana de abastecimento (segunda a sexta)',
  `semana_abastecimento_inicio` date DEFAULT NULL COMMENT 'Incio da semana de abastecimento (segunda)',
  `semana_abastecimento_fim` date DEFAULT NULL COMMENT 'Fim da semana de abastecimento (sexta)',
  `data_entrega_cd` date DEFAULT NULL COMMENT 'Data de entrega no CD (quarta-feira da semana anterior  semana de abastecimento)',
  `semana_consumo` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Semana de consumo (segunda a domingo)',
  `semana_consumo_inicio` date DEFAULT NULL COMMENT 'Incio da semana de consumo (segunda)',
  `semana_consumo_fim` date DEFAULT NULL COMMENT 'Fim da semana de consumo (domingo)',
  `mes_referencia` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Ms de referncia baseado na segunda-feira da semana',
  `mes_referencia_ano` int NOT NULL COMMENT 'Ano do ms de referncia',
  `mes_referencia_numero` int NOT NULL COMMENT 'Nmero do ms de referncia',
  `feriado` tinyint(1) DEFAULT '0' COMMENT '0=No, 1=Sim',
  `nome_feriado` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `dia_util` tinyint(1) DEFAULT '1' COMMENT '0=No, 1=Sim (segunda a sexta)',
  `dia_abastecimento` tinyint(1) DEFAULT '1' COMMENT '0=No, 1=Sim (segunda a sexta)',
  `dia_consumo` tinyint(1) DEFAULT '1' COMMENT '0=No, 1=Sim (segunda a domingo)',
  `observacoes` text COLLATE utf8mb4_unicode_ci,
  `criado_em` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `atualizado_em` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_data` (`data`),
  KEY `idx_ano_mes` (`ano`,`mes`),
  KEY `idx_semana_ano` (`semana_ano`,`semana_numero`),
  KEY `idx_dia_semana` (`dia_semana_numero`),
  KEY `idx_mes_referencia` (`mes_referencia_ano`,`mes_referencia_numero`)
) ENGINE=InnoDB AUTO_INCREMENT=2558 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

