--
-- Table structure for table `media_escolas`
--

DROP TABLE IF EXISTS `media_escolas`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `media_escolas` (
  `id` int NOT NULL AUTO_INCREMENT,
  `escola_id` int NOT NULL COMMENT 'ID da escola (relaciona com unidades_escolares do Foods)',
  `escola_nome` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `nutricionista_id` int NOT NULL COMMENT 'ID da nutricionista responsvel',
  `media_lanche_manha` int NOT NULL DEFAULT '0',
  `media_parcial_manha` int NOT NULL DEFAULT '0',
  `media_almoco` int NOT NULL DEFAULT '0',
  `media_lanche_tarde` int NOT NULL DEFAULT '0',
  `media_parcial_tarde` int NOT NULL DEFAULT '0',
  `media_eja` int NOT NULL DEFAULT '0',
  `ativo` tinyint(1) NOT NULL DEFAULT '1',
  `data_cadastro` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `data_atualizacao` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `calculada_automaticamente` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'Se foi calculada automaticamente',
  `quantidade_lancamentos` int NOT NULL DEFAULT '0' COMMENT 'Quantidade de lanamentos usados no clculo',
  `data_calculo` timestamp NULL DEFAULT NULL COMMENT 'Data do ltimo clculo automtico',
  `ultima_atualizacao_registros` timestamp NULL DEFAULT NULL COMMENT 'Data da ltima atualizao dos registros',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_escola` (`escola_id`),
  KEY `idx_nutricionista` (`nutricionista_id`),
  KEY `idx_escola` (`escola_id`),
