--
-- Table structure for table `necessidades`
--

DROP TABLE IF EXISTS `necessidades`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `necessidades` (
  `id` int NOT NULL AUTO_INCREMENT,
  `usuario_id` int NOT NULL,
  `usuario_email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `escola_id` int NOT NULL,
  `escola` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `escola_rota` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `codigo_teknisa` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `produto_id` int NOT NULL,
  `produto` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `produto_unidade` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ajuste` decimal(10,3) NOT NULL DEFAULT '0.000',
  `semana_consumo` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `semana_abastecimento` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `data_preenchimento` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `data_atualizacao` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `status` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'NEC' COMMENT 'Status da necessidade: NEC (criada pela nutricionista), APROVADA (aprovada pela coordenao), etc.',
  `observacoes` text COLLATE utf8mb4_unicode_ci COMMENT 'Observaes sobre a anlise e aprovao da necessidade',
  `necessidade_id` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'ID nico para agrupar produtos da mesma necessidade',
  `ajuste_nutricionista` decimal(10,3) DEFAULT NULL COMMENT 'Ajuste feito pela nutricionista para a quantidade do produto',
  `ajuste_coordenacao` decimal(10,3) DEFAULT NULL COMMENT 'Ajuste feito pela coordenao para a quantidade da necessidade',
  `ajuste_conf_nutri` decimal(10,3) DEFAULT NULL COMMENT 'Valor ajustado confirmado pela nutricionista',
  `ajuste_conf_coord` decimal(10,3) DEFAULT NULL COMMENT 'Valor ajustado confirmado pela coordenao',
  `ajuste_anterior` decimal(10,3) DEFAULT NULL COMMENT 'Valor anterior do ajuste antes da ltima atualizao',
  `substituicao_processada` tinyint(1) DEFAULT '0' COMMENT 'Indica se a necessidade j foi processada para substituio (0=no, 1=sim)',
  `grupo` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Grupo do produto',
  `grupo_id` int DEFAULT NULL COMMENT 'ID do grupo do produto',
  `ajuste_logistica` decimal(10,3) DEFAULT NULL COMMENT 'Ajuste feito pela logstica para a quantidade da necessidade',
  `total` decimal(10,3) DEFAULT NULL COMMENT 'Total calculado automaticamente (soma de todas as quantidades por perodo)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_necessidade_unica` (`usuario_id`,`escola_id`,`produto_id`,`semana_consumo`),
  KEY `idx_usuario_id` (`usuario_id`),
  KEY `idx_escola_id` (`escola_id`),
  KEY `idx_produto_id` (`produto_id`),
  KEY `idx_semana_consumo` (`semana_consumo`),
  KEY `idx_semana_abastecimento` (`semana_abastecimento`),
  KEY `idx_necessidades_status` (`status`),
  KEY `idx_necessidades_necessidade_id` (`necessidade_id`),
  KEY `idx_necessidades_ajuste_nutricionista` (`ajuste_nutricionista`),
  KEY `idx_necessidades_substituicao_processada` (`substituicao_processada`),
  KEY `idx_necessidades_grupo` (`grupo`),
