/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `necessidades_substituicoes` (
  `id` int NOT NULL AUTO_INCREMENT,
  `necessidade_id` int NOT NULL COMMENT 'ID da linha na tabela necessidades (PK da necessidade especfica, no necessidade_id do agrupamento)',
  `necessidade_id_grupo` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'ID de agrupamento das necessidades (mesmo id usado para agrupar por escola/perodo)',
  `produto_origem_id` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'ID/cdigo do produto origem solicitado',
  `produto_origem_nome` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Nome do produto origem',
  `produto_origem_unidade` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Unidade de medida do produto origem',
  `produto_generico_id` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'ID do produto genrico (do Foods)',
  `produto_generico_codigo` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Cdigo do produto genrico',
  `produto_generico_nome` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Nome do produto genrico',
  `produto_generico_unidade` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Unidade de medida do produto genrico',
